import React from 'react';
import TextField from '@material-ui/core/TextField';

export default function Form() {
	return (
		<div>
			<form noValidate autoComplete="off">
				<TextField style={{padding: 100}} 
					id="standard-basic"
					label="Insert Text" 
					margin="normal"/>
				<TextField id="time" label="Select a time" type="time" defaultValue="07:30"/>
			</form>
		</div>
	);
}
